import React from 'react';
import { ManagementToolNav } from '../../../common/components'
import { TextField } from '../../../common/components'

import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';

function DashboardTemplate(props) {
    const { form } = props.viewStore;
    return (
        <div>
            <ManagementToolNav />
            <h1>Create category</h1>
            <Form>
                <Form.Group>
                    <TextField type={'text'} field={form.$('category')} />
                </Form.Group>
            </Form>
            <Button variant="btn btn-light" onClick={navigateDashboard}>Back</Button>
        </div>
    )
}

export default DashboardTemplate;
